const express = require("express");
const router = express.Router();
const auth = require("../middleware/auth");
const { documentUpload } = require("../middleware/upload");
const {
  uploadDocuments,
  completeDocument,
  deleteDocument,
  getUserDocuments,
  getAllUsersWithDocuments
} = require("../controllers/documents");

router.post("/", auth, documentUpload, uploadDocuments);
router.put("/:documentId/complete", auth, completeDocument);
router.delete("/:documentId", auth, deleteDocument);
router.get("/my-documents", auth, getUserDocuments);
router.get("/all-users", auth, getAllUsersWithDocuments);

module.exports = router;
